ror = lambda val, r_bits, max_bits: \
    ((val & (2**max_bits-1)) >> r_bits%max_bits) | \
    (val << (max_bits-(r_bits%max_bits)) & (2**max_bits-1))

def calculate_hash(fname):
	hash = 0
	for c in fname:
		num = ord(c)
		hash = ror(hash, 0xD, 32)
		hash += num
	return (hash)

for gh in goal_hashes:
	for f in func_names:
		fhash = calculate_hash(f)
		if fhash == gh:
			print("{} -> {}".format(f, hex(gh)))
			break
